import {Component} from 'react';




class ProjectCard extends Component{
    render() {
        return (
            <CardWarp>
            <div>
                <p>ID #000000</p>
                <h3>Nome do Projeto</h3>
            </div>
            <p>Autor: Thales Azevedo</p>
            <p>Descrição: O proejto com tal nome tem a roposta de pesquisar tal assunto e obter resutados que podem causar tais impactos.</p>
            <p>N de Arquivos: 10</p>
            <p>Ultima Atuaização: 00/00/0000</p>
            </CardWarp>
        )
    }
}

export default ProjectCard
